import React, { useState } from 'react';
import { X } from 'lucide-react';
import { RadioGroup, RadioGroupItem } from "@/components/ui/radio-group"
import { Label } from "@/components/ui/label"
import { Button } from "@/components/ui/button"

const Communication = () => {
  const [selectedOption, setSelectedOption] = useState('STARSV1');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Selected option:', selectedOption);
  };

  const handleCancel = () => {
    console.log('Cancel clicked');
    // Add any cancel logic here
  };

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-8">Communication</h1>
      <div className="max-w-2xl mx-auto bg-gray-200 rounded-lg p-6 relative">
        <button className="absolute right-2 top-2 p-2 hover:bg-gray-300 rounded-md">
          <X className="h-4 w-4" />
        </button>
        
        <form onSubmit={handleSubmit} className="space-y-8">
          <RadioGroup 
            defaultValue={selectedOption} 
            onValueChange={setSelectedOption}
            className="space-y-4"
          >
            <div className="flex items-center space-x-2">
              <RadioGroupItem value="STARSV1" id="STARSV1" />
              <Label htmlFor="STARSV1">STARSV 1</Label>
            </div>
            <div className="flex items-center space-x-2">
              <RadioGroupItem value="TADIRAN1" id="TADIRAN1" />
              <Label htmlFor="TADIRAN1">TADIRAN 1</Label>
            </div>
            <div className="flex items-center space-x-2">
              <RadioGroupItem value="STARSV2" id="STARSV2" />
              <Label htmlFor="STARSV2">STARSV 2</Label>
            </div>
            <div className="flex items-center space-x-2">
              <RadioGroupItem value="TADIRAN2" id="TADIRAN2" />
              <Label htmlFor="TADIRAN2">TADIRAN 2</Label>
            </div>
            <div className="flex items-center space-x-2">
              <RadioGroupItem value="HCRR" id="HCRR" />
              <Label htmlFor="HCRR">HCRR</Label>
            </div>
            <div className="flex items-center space-x-2">
              <RadioGroupItem value="OFC" id="OFC" />
              <Label htmlFor="OFC">OFC</Label>
            </div>
            <div className="flex items-center space-x-2">
              <RadioGroupItem value="SDR" id="SDR" />
              <Label htmlFor="SDR">SDR</Label>
            </div>
          </RadioGroup>

          <div className="flex justify-end space-x-4 mt-6">
            <Button type="submit" variant="default">Ok</Button>
            <Button type="button" variant="secondary" onClick={handleCancel}>Cancel</Button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default Communication;
